*********************************************</div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</div>\r\n		<div>\r\n			Best regards,</div>\r\n		<div>\r\n			M I Synergy Support Team.</div>\r\n	</body>\r\n</html>\r\n', '2015-02-18 11:04:55', '2015-02-18 11:04:55', 'A', 'I', '', '2015-02-18 11:04:55', 'P', '', '2013-05-29 13:43:14', 'P', '', '2013-05-30 13:43:31');
