INSERT INTO `mail_mst` VALUES ('386', '803', '1', 'mail-template/template7.vm', 'support@misynergy.com', 'damith@mi-synergy.com,damindaskd@gmail.com,', 'damith@mi-synergy.com', 'MI-Synergy Support System (Ticket No - 803)', '<html>\r\n	<body>\r\n		<div>\r\n			Dear ndbbank,</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp; The Support Ticket 803 is automatically closed by the system. Please&nbsp; <a href=\"http://support.misynergy.com/loginPage.htm?TYPE=email&amp;TICKET_ID=803\">click here</a> to review it..</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			-----------------------------------------------------------------------------------------------------------------------------------------</div>\r\n		<div>\r\n			<strong>Ticket ID :</strong> 803</div>\r\n		<div>\r\n			<strong>Heading :</strong> Error in Utility payment reversals</div>\r\n		<div>\r\n			<strong>Description :</strong> Dear All,\r\nWhen we do a utility payment reversal in T24 corebanking system, utility system still picks the reversed transaction. In corebanking system we reverse the same transaction with the same bank reference number. (It is not just debit the same amount which is credited previously).\r\nSo please handle these reversals in the below mentioned manner.\r\n1.0 Reversal record too will be downloaded into the Mysql table.\r\n2.0 If you find any txn with a negative value, please get the bank reference number of that particuler transaction and search in the same table for same bank reference number.\r\n\r\n3.0 There should be one record with the same bank reference number. That is the initial transaction before reversal take place. \r\n\r\n4.0 Mark both the transactions as reversals and these two transactions should not come to down load file and should be indicate in the reversals report.\r\n\r\nPlease contact me if you need more details on this issue.\r\n\r\nAppreciate if you could make arrangments to fix the issue at your earlist.\r\n\r\nThanks\r\n\r\nVickum\r\n\r\n\r\n </div>\r\n		<div>\r\n			-----------------------------------------------------------------------------------------------------------------------------------------</div>\r\n		<div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</div>\r\n		<div>\r\n			Best regards,</div>\r\n		<div>\r\n			M I Synergy Support Team.</div>\r\n	</body>\r\n</html>\r\n', '2015-02-18 05:08:13', '2015-02-18 05:08:13', 'A', 'I', '', '2015-02-18 05:08:13', 'P', '', '2013-05-29 13:43:14', 'P', '', '2013-05-30 13:43:31');
INSERT INTO `mail_mst` VALUES ('387', '803', '1', 'mail-template/template7_2.vm', 'support@misynergy.com', 'daminda@mi-synergy.com,chandima@mi-synergy.com,', 'damith@mi-synergy.com', 'MI-Synergy Support System (Ticket No - 803)', '<html>\r\n	<body>\r\n		<div>\r\n			Dear Admin,</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			&nbsp; The Support Ticket 803 is automatically closed by the system. Please&nbsp; <a href=\"http://support.misynergy.com/loginPage.htm?TYPE=email&amp;TICKET_ID=803\">click here</a> to review it..</div>\r\n		<div>\r\n			&nbsp;</div>\r\n		<div>\r\n			-----------------------------------------------------------------------------------------------------------------------------------------</div>\r\n		<div>\r\n			<strong>Ticket ID :</strong> 803</div>\r\n		<div>\r\n			<strong>Heading :</strong> Error in Utility payment reversals</div>\r\n		<div>\r\n			<strong>Description :</strong> Dear All,\r\nWhen we do a utility payment reversal in T24 corebanking system, utility system still picks the reversed transaction. In corebanking system we reverse the same transaction with the same bank reference number. (It is not just debit the same amount which is credited previously).\r\nSo please handle these reversals in the below mentioned manner.\r\n1.0 Reversal record too will be downloaded into the Mysql table.\r\n2.0 If you find any txn with a negative value, please get the bank reference number of that particuler transaction and search in the same table for same bank reference number.\r\n\r\n3.0 There should be one record with the same bank reference number. That is the initial transaction before reversal take place. \r\n\r\n4.0 Mark both the transactions as reversals and these two transactions should not come to down load file and should be indicate in the reversals report.\r\n\r\nPlease contact me if you need more details on this issue.\r\n\r\nAppreciate if you could make arrangments to fix the issue at your earlist.\r\n\r\nThanks\r\n\r\nVickum\r\n\r\n\r\n </div>\r\n		<div>\r\n			-----------------------------------------------------------------------------------------------------------------------------------------</div>\r\n		<div>\r\n			<div>\r\n				&nbsp;</div>\r\n		</div>\r\n		<div>\r\n			Best regards,</div>\r\n		<div>\r\n			M I Synergy Support Team.</div>\r\n	</body>\r\n</html>\r\n', '2015-02-18 05:08:13', '2015-02-18 05:08:13', 'A', 'I', '', '2015-02-18 05:08:13', 'P', '', '2013-05-29 13:43:14', 'P', '', '2013-05-30 13:43:31');
