INSERT INTO `ticket_reply_mst` VALUES ('61', '1', 'R', 'This is the mail system at host senoksl.com.\r\n\r\nI\'m sorry to have to inform you that your message could not\r\nbe delivered to one or more recipients. It\'s attached below.\r\n\r\nFor further assistance, please send mail to postmaster.\r\n\r\nIf you do so, please include this problem report. You can\r\ndelete your own text from the attached returned message.\r\n\r\n                   The mail system\r\n\r\n<karendealwis@aol.com>: host mailin-01.mx.aol.com[64.12.90.1] refused to talk\r\n    to me: 554- (RTR:CH)  http://postmaster.info.aol.com/errors/554rtrch.html\r\n    554  Connecting IP: 203.94.68.22', '', '', '', '', '', 'senoksl', '2013-04-03 10:54:45', 'I', 'Y', 'I', 'senoksl', '2013-04-03 10:54:45', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('61', '2', 'A', '\"When an AOL member clicks \"This Is Spam\" for a piece of email sent from one of your IPs, this is considered a \"complaint\". If you are having difficulty delivering email to AOL, a feedback loop (FBL) would benefit you. Once you have created a feedback loop, we will send you a copy of each complaint generated when an AOL member reports your email as spam. Monitoring FBLs benefits both bulkmailers and ISPs, in that they help to manage mailing lists as well as providing early warnings of network security issues such as bot infestations, compromised web forms, and other such sources of spam and abuse. \"\r\n\r\nhttp://postmaster.aol.com/Postmaster.FeedbackLoop.php\r\n\r\nYou have to apply for a FBL and see what kind of emails are getting complaints. http://postmaster.aol.com/SupportRequest.FBL.php\r\n\r\nThen you have to open a support ticket with them and request their help. http://postmaster.aol.com/SupportRequest.php\r\n\r\nThe reason may be that any affected client computers shoot spam emails or any forwarded emails are being marked by AOL clients as spam. As we said earlier, It is better only to give web mail access to clients without giving them smtp and pop access through various email clients.', '', '', '', '', '', 'yasantha', '2013-04-03 12:00:07', 'I', 'Y', 'I', 'yasantha', '2013-04-03 12:00:07', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
