INSERT INTO `ticket_reply_mst` VALUES ('89', '3', 'A', 'BCC information is not shown in normal email header. It is the mechanism how smtp servers behave. But if you look at full header details by right clicking email and going to \"Show Original\", you will see the recipient and sender details. But If several recipients are put into bcc field, other recipients are not shown to you. You will see only your address in recipient filed. That is the normal behavior. \n\nSAMPLE OUTPUT OF A SHOW ORIGINAL. SEVERAL EMAILS PUT INTO BCC FIELD. BUT ONLY INTENDED RECIPIENT WILL BE SHOWN IN \"TO\" FIELD AS;\nFrom: Rushan Amarasinghe &lt;rushan@misynergy.com&gt;\nTo: Ya &lt;ya@misynergy.com&gt;\n\n\nFULL HEADER\nReturn-Path: rushan@misynergy.com\nReceived: from misynergy.com (LHLO misynergy.com) (192.168.0.1) by\n misynergy.com with LMTP; Mon, 13 May 2013 22:44:55 +0530 (IST)\nReceived: from localhost (localhost [127.0.0.1])\n	by misynergy.com (Postfix) with ESMTP id C83A4221A51;\n	Mon, 13 May 2013 22:44:55 +0530 (IST)\nX-Virus-Scanned: amavisd-new at misynergy.com\nX-Spam-Flag: NO\nX-Spam-Score: -2.9\nX-Spam-Level:\nX-Spam-Status: No, score=-2.9 tagged_above=-10 required=6.6\n	tests=[ALL_TRUSTED=-1, BAYES_00=-1.9, T_FAKE_REPLY_SURE_B=0.01,\n	T_KHOP_THREADED=-0.01, T_NOT_A_PERSON=-0.01, T_RP_MATCHES_RCVD=-0.01,\n	T_THREAD_INDEX_BAD=0.01, T_UNKNOWN_ORIGIN=0.01] autolearn=ham\nReceived: from misynergy.com ([127.0.0.1])\n	by localhost (misynergy.com [127.0.0.1]) (amavisd-new, port 10026)\n	with ESMTP id 7wEW0h_OPRh3; Mon, 13 May 2013 22:44:52 +0530 (IST)\nReceived: from misynergy.com (misynergy.com [192.168.0.1])\n	by misynergy.com (Postfix) with ESMTP id 76F6E221A50;\n	Mon, 13 May 2013 22:44:51 +0530 (IST)\nDate: Mon, 13 May 2013 22:44:51 +0530 (IST)\nFrom: Rushan Amarasinghe &lt;rushan@misynergy.com&gt;\nTo: Ya &lt;ya@misynergy.com&gt;\nMessage-ID: <639645860.1.1368465291258.JavaMail.root@misynergy.com>\nIn-Reply-To: <794561340.0.1368465123272.JavaMail.root@misynergy.com>\nReferences: <794561340.0.1368465123272.JavaMail.root@misynergy.com>\nSubject: Re: Test\nMIME-Version: 1.0\nContent-Type: text/plain; charset=utf-8\nContent-Transfer-Encoding: 7bit\nX-Originating-IP: [192.168.0.20]\nX-Mailer: Zimbra 8.0.0_GA_5434 (ZimbraWebClient - FF20 (Win)/8.0.0_GA_5434)\nThread-Topic: Test\nThread-Index: COiigK4DCycZkc5YunYq5Uc77YZNmupDkQEG\n', '', '', '', '', '', 'yasantha', '2013-05-13 14:24:34', 'I', 'Y', 'I', 'yasantha', '2013-05-13 14:24:34', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
