INSERT INTO `ticket_reply_mst` VALUES ('173', '1', 'R', 'Email allerts are not getting generating after server migration. \r\n\r\nWhen Bank admin user create a new user or when reset the user password, external users are getting an email notification with the new password. But this process is not working in production now.\r\n\r\nAppreciate your urgent attention.\r\n\r\nRegards\r\n\r\nVickum', '', '', '', '', '', 'ndbbank', '2013-08-19 13:29:17', 'I', 'Y', 'I', 'ndbbank', '2013-08-19 13:29:17', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '2', 'A', 'The only difference between the old server and new one is that instead of the email server hostname, private IP address is used. This was asked by NDB IT as we are not allowed to use Internal DNS server to resolve email server hostname. On the other hand this issue was not identified during UAT by NDB. Please refer support ticket 123.\r\n\r\nWhen we test it in test environment, emails are getting delivered properly even when IP address is used instead of mail server hostname. We will further troubleshoot this in order to find an alternative solution. Further please check your email server logs and find out the reason why the email are getting rejected and anything can be done from email server side.', '', '', '', '', '', 'yasantha', '2013-08-21 08:13:39', 'I', 'Y', 'I', 'yasantha', '2013-08-21 08:13:39', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '3', 'R', 'Dear Yasantha,Please find below attached feedback from our network Team. \r\nIt seems this issue cannot be fixed off site. Please come and discuss the same with our network team. \r\n\r\nWe don\'t want to drag this issue further more. Users are escalating this issue and I hope you can understand the situation here.\r\n\r\nRegards\r\n\r\nVickum ', '', '', '', '', '', 'ndbbank', '2013-08-22 11:36:17', 'I', 'Y', 'I', 'ndbbank', '2013-08-22 11:36:17', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '4', 'A', 'Please confirm that the following credentials are correct\r\n \r\nEmailUser=ndb@ndbbank.com\r\nEmailPassword=utility\r\n \r\nAbove credentials are used for sig verification system. But when you telnet you have used signaturelive@ndbbank.com', '', '', '', '', '', 'yasantha', '2013-08-22 13:04:40', 'I', 'Y', 'I', 'yasantha', '2013-08-22 13:04:40', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '5', 'R', 'Dear Yasantha,\r\n\r\nSudesh has provided you requested information through email. Can we close this issue today. Email function is not working since the server migration. \r\nAppreciate if you could attend to this issue urgently.\r\nRegards\r\n\r\nVickum', '', '', '', '', '', 'ndbbank', '2013-08-23 10:56:22', 'I', 'Y', 'I', 'ndbbank', '2013-08-23 10:56:22', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '6', 'A', 'Email generation function is working properly in test environment. We tested using couple of mail servers. \r\n \r\nSystem.properties file extract\r\nMailHost=192.168.0.3\r\nEmailUser=sysadmin@misynergy.com\r\nEmailPassword=123456\r\n\r\nApplication log\r\n2013-08-27 16:14:45 : DEBUG: USER LOGIN â??> TEST1\r\n2013-08-27 16:15:12 : Authorize Update User Data -> UserID=TEST2\r\n2013-08-27 16:16:37 : Generate Password -> UserID= 24\r\n2013-08-27 16:16:55 :\r\nDear Ms Test User 2,\r\n \r\nWe are delighted to welcome you to NDB Bank\'s signature management system.  Please log on to our website https://sig.ndbbank.com to view Bank\'s authorized signatures\r\n \r\n   Your User ID for this service is :  TEST2\r\n \r\n   Password is :  66QNGA/W\r\n \r\nThis password  will be accepted only once, hence when you log-in for the first time, you will be prompted to change the password. The password is case-sensitive and must consist of alphabetic, numerical and non-alphanumeric characters.\r\n \r\nNDB Bank PLC\r\n \r\n \r\nThis is an automated message, please do not reply!\r\n2013-08-27 16:16:55 : SEND User Password OK -> UserID= TEST2\r\n2013-08-27 16:17:27 : E-mail -> TO: ya@misynergy.com ,  CC: , Subject: User account details for accessing NDB Bank PLC - Signature Verification System\r\n====================================================\r\n \r\nWhen we search forums regarding this issue, we found several reasons like;\r\n===========================\r\nCause\r\nCommunication failure in the SMTP level, during the ehlo/helo command exchange.\r\n \r\nIt can be caused by many reasons, but the usual suspects are:\r\n \r\n    Firewall.\r\n    Authentication issue.\r\n    Hostname of the machine is different to what the mailserver expects.\r\n    Underscore(_) in the host name. The underscore character is not a permitted character for the hostname.\r\n=====================================================\r\nhttps://confluence.atlassian.com/display/CONFKB/Getting+%27501+Syntactically+invalid+HELO+argument%27+Error+when+Sending+Mail+From+Confluence\r\n \r\nThe error is generated from the email server side failing the authentication of application server. Therefore it is better to forward this issue to email server administrator. This may be due to a protocol check or DNS check on email server.\r\n', '', '', '', '', '', 'yasantha', '2013-08-27 08:53:33', 'I', 'Y', 'I', 'yasantha', '2013-08-27 08:53:33', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '7', 'A', 'The issue is sorted out after changing sig app server hostname to lkeslsigs1.ndbbank.com (fully qualified hostname). This may be due to a reason that some kind of hostname verification takes place during helo/ehlo connection establishment between app server and email server. ', '', '', '', '', '', 'yasantha', '2013-08-28 11:25:52', 'I', 'Y', 'I', 'yasantha', '2013-08-28 11:25:52', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '8', 'R', 'Hi Yasantha,\r\n\r\nWhy this type of issue suddenly surfaced after changing hardware? I don\'t understand the relation in full host name and hadware change. \r\n\r\nIt seems application behaviour is dynamic depending on hardware where it is installed on.\r\n\r\nRegards\r\n\r\nVickum ', '', '', '', '', '', 'ndbbank', '2013-08-28 11:56:38', 'I', 'Y', 'I', 'ndbbank', '2013-08-28 11:56:38', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '9', 'A', 'Dear Vickum,\r\n\r\nIt appears that you are unaware of the facts of the issue and you are making comments without proper understanding or knowledge of the process and technology involved in systems. \r\n\r\nPlease refer update 1 where it would be apparent that we had to change the DNS resolving to direct IP due to NDB requesting to remove DNS. Therefore the change in communication protocol was carried out at the request of NDB IT.  \r\n\r\nFurther under support ticket 123, NDB IT has confirmed that the UAT of the system was completed without any issues. The UAT certified system was converted as live server without any changes from the UAT technical specification. Therefore if this functionality had been tested in UAT, then the live environment would provide the same results as the test environment.\r\n\r\nFor email communication the UAT and the live had the same communication method, however until such time fully qualified hostname was used the mails were not getting accepted by the mail server. The normal practice is to use FQHN for any server or any host, but from inception NDB IT has been using only single code for hostname (lkeslsigs1), which had been in use until the new server was deployed. \r\n\r\nThe same communication method has been deployed in much larger installations in several applications on multiple email severs including Lotus and this is the first time that this type of issue has come up in any of our installations.\r\n\r\nTherefore we would appreciate proper understanding of issues and gaining of knowledge is made before making any comments.\r\n\r\nRegards,\r\n\r\nYasantha', '', '', '', '', '', 'yasantha', '2013-08-29 07:02:02', 'I', 'Y', 'I', 'yasantha', '2013-08-29 07:02:02', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('173', '10', 'R', 'Dear Yasantha,\r\n\r\nThanks for the update. \r\nI didn\'t go detail in this issue since the issue is assigned a some other person. My job is to coordinate with the vendor and the techinical team. So I made all these points based on my observations and the feedback received from team mates. If the issue is not clear, it is our right to get it clarified from the vendor. So I reaised my concerns and you provided answers to them. Thats it. \r\n\r\nPlese chek in my last post. I have raised only a concern. But you all take it as a statement.\r\n\r\nRegards\r\n\r\nVickum', '', '', '', '', '', 'ndbbank', '2013-08-30 05:32:24', 'I', 'Y', 'I', 'ndbbank', '2013-08-30 05:32:24', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
