INSERT INTO `ticket_reply_mst` VALUES ('210', '1', 'R', 'Daily Txn. Limit sets, when creating users\r\n\r\nFCY to LKR transfer amounts are not compared with the Daily Transaction Limit (user level)\r\n\r\nUser ID - SEND2TURNY\r\nTxn date - 2013-09-07\r\nDaily Transaction Limit  - Rs.300,000.00\r\nTo Account Number - 6885885 (USD)\r\nFrom Account Number -  3482876 (LKR)\r\nFCY to LKR transfer amount - USD 2,000.00 * 2\r\n', '', '', '', '', '', 'bocuser', '2013-09-09 14:34:38', 'I', 'Y', 'I', 'bocuser', '2013-09-09 14:34:38', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('210', '2', 'A', 'It is given that the TO account is a Dollar account and FROM account is a Rupee account. But we believe that the transaction happened other way.\r\n\r\nTransaction limits are checked only when debiting the account. For FCY accounts, the per transaction limit is USD 2000. Therefore two times of debits of USD 2000 is considered legitimate. From the inception, BOC did not want to have a Daily Transaction Limit for FCY accounts. The Internet banking system does not maintain any currency conversion data and all conversions are done by the core banking system.\r\n\r\nThe user limit of Rs. 300,000/- will be checked only in cases of debits where as in this situation, the rupee account is credited. \r\n\r\nIf BOC wants to have a daily transaction limit for FCY accounts, the scope should be discussed and we can proceed accordingly.\r\n\r\nPlease refer the attached email regarding the user level validations.\r\n\r\n', '', '', '', '', '', 'navin', '2013-09-11 15:30:47', 'I', 'Y', 'I', 'navin', '2013-09-11 15:30:47', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
