INSERT INTO `ticket_reply_mst` VALUES ('296', '2', 'A', 'Please let me know the output of the following sql to investigate the issue further. \r\n\r\nselect t1.contract_no,t2.maturity_date,sum(t1.interest) as interest,\r\nsum(t1.capital) as capital, sum(t1.tax) as tax\r\nfrom globus_collection_mst t1, globus_mg_mst t2 \r\n where t1.custno in (169227,132195) \r\n and t1.txndate between \'2012-04-01\' and \'2013-03-31\' \r\n and t1.category=3120 \r\n and t1.contract_no=t2.contract_no\r\nand t1.custno=t2.custno\r\nand t1.txnyear=t2.txnyear\r\nand t1.txnmonth=t2.txnmonth\r\nand t2.txndate between \'2012-04-01\' and \'2013-03-31\' \r\n group by t1.contract_no\r\norder by t1.contract_no\r\n', '', '', '', '', '', 'damith', '2013-10-22 11:29:22', 'I', 'Y', 'I', 'damith', '2013-10-22 11:29:22', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('296', '3', 'A', 'Dear Dasitha,\r\n\r\nAs per the mail sent by you our records indicate that the figures stated in report are same as the data in database, therefore the issue must be in your uploaded data files. Please check \r\n\r\nThanks,\r\nRegards,\r\nDamith\r\n\r\n\r\n\r\n\r\n\r\n\r\n==========================\r\n\r\n\r\nDear Damith, \r\n\r\nPlease find the attached results. \r\n\r\n\r\n\r\n\r\nThanks & Regards,\r\nDasitha. \r\n\r\n \r\n\r\n\r\n\r\nFrom: 	\"Damith Beneragame\" <damith@mi-synergy.com> \r\nTo: 	<Dasitha.Karunajeewa@ndbbank.com> \r\nCc: 	<Nilusha.Silva@ndbbank.com>, <Ranga.Warunakulasuriya@ndbbank.com>, <Ravinda.Bandara@ndbbank.com> \r\nDate: 	22/10/2013 02:53 PM \r\nSubject: 	RE: Balance Confirmation system\r\n\r\n________________________________________\r\n\r\n\r\n\r\nDear Dasitha, \r\n \r\nPlease let me know the output of the following sql to investigate the issue further. \r\n\r\n  \r\nselect t1.contract_no,t2.maturity_date,sum(t1.interest) as interest, \r\nsum(t1.capital) as capital, sum(t1.tax) as tax \r\nfrom globus_collection_mst t1, globus_mg_mst t2 \r\n where t1.custno in (169227,132195) \r\n and t1.txndate between \'2012-04-01\' and \'2013-03-31\' \r\n and t1.category=3120 \r\n and t1.contract_no=t2.contract_no \r\nand t1.custno=t2.custno \r\nand t1.txnyear=t2.txnyear \r\nand t1.txnmonth=t2.txnmonth \r\nand t2.txndate between \'2012-04-01\' and \'2013-03-31\' \r\n group by t1.contract_no \r\norder by t1.contract_no \r\n  \r\n  \r\n  \r\nThanks, \r\nRegards, \r\nDamith. \r\n', '', '', '', '', '', 'damith', '2013-10-24 09:00:53', 'I', 'Y', 'I', 'damith', '2013-10-24 09:00:53', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
