INSERT INTO `ticket_reply_mst` VALUES ('359', '1', 'R', 'Dear Uditha,\r\n\r\nAs explained to you over the phone we are in the process of arranging the Life Insurance policies in the Panadura storage according to the policy number order. Therefore we need a system generated excel based report to identify the box number where the documents are stored for each policy number.\r\n\r\nThis is a onetime requirement since in future the documents will be stored in the storage according to the policy number order and not by the box number order. There is no need to do a system change and if the relevant details can be extracted from the data base that would be sufficient. The relevant details required in the report are given below.\r\n\r\n1.	If there are several documents (proposal, servicing, claims) in various boxes under one policy, all the box numbers should be given in separate columns. \r\n2.	If the policy number is repeating under different products all the policy numbers should be in  the list\r\n\r\nPlease treat this as urgent since we need the data prior to next Saturday 16/11/13\r\n\r\nSample report\r\n\r\nProduct	Policy Number	Customer Name	Box # 1	Box # 2	Box # 3	Box # 4	Box # 5	Box # 6	Box # 7\r\nULP	1		25	152	253				\r\nMRT	1		10						\r\nUPR	1		456	463					\r\nULP	2		26						\r\nULP	3		26	162					\r\n									\r\n\r\n\r\n', '', '', '', '', '', 'allianz', '2013-11-14 09:40:55', 'I', 'Y', 'I', 'allianz', '2013-11-14 09:40:55', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('359', '2', 'A', 'Dear Uditha,\r\n\r\nherewith I have attached the required excel sheet', '', '', '', '', '', 'damith', '2013-11-15 12:58:25', 'I', 'Y', 'I', 'damith', '2013-11-15 12:58:25', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
