INSERT INTO `ticket_reply_mst` VALUES ('397', '1', 'R', 'Utility payment transactions which were downloaded from core banking system during week end (30th and 1st), has not being processed by the utility system. Core banking interfacing application also confirms that downloaded records successfully handed over to the intermediate oracle table.\r\n\r\nPlease let us know the reason for this issue.', '', '', '', '', '', 'ndbbank', '2013-12-02 18:01:21', 'I', 'Y', 'I', 'ndbbank', '2013-12-02 18:01:21', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
