INSERT INTO `ticket_reply_mst` VALUES ('397', '3', 'A', 'Can we get the data from oracle table that has not been processed, for further investigations.', '', '', '', '', '', 'damith', '2013-12-09 12:18:57', 'I', 'Y', 'I', 'damith', '2013-12-09 12:18:57', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('397', '4', 'A', 'Dear Vikum,\r\n\r\nAs per the telephone conversation had with you, following is a sample of SQL that we use to pick data form oracle. You can get the exact SQLs from sql_query field on utility_provider_mst table in mysql database. Replace ? character in SQL by the required date in â??11-DEC-13â?? (dd-MMM-yy) format.\r\n\r\n\r\nselect distinct DAT_TXN, AMT_TXN, TXT_TXN_DESC, NAM_BRANCH, a.CTR_UPDAT_SRLNO,lpad(rownum,5,~0~) \r\nfrom ch_nobook a, ba_cc_brn_mast b\r\nwhere a.COD_CC_BRN_TXN = b.COD_CC_BRN \r\nand a.cod_acct_no = ~900002007345~ \r\nand a.cod_drcr=~C~ \r\nand SUBSTR(DAT_TXN,1,9)=?   < â??11-DEC-13â??\r\n\r\n\r\nThanks,\r\nRegards,\r\nDamith.\r\n', '', '', '', '', '', 'damith', '2013-12-11 08:18:17', 'I', 'Y', 'I', 'damith', '2013-12-11 08:18:17', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('397', '5', 'A', 'Dear Vikum,\r\n\r\nAs per the telephone conversation had with you, following is a sample of SQL that we use to pick data form oracle. You can get the exact SQLs from sql_query field on utility_provider_mst table in mysql database. Replace ? character in SQL by the required date in \'11-DEC-13\' (dd-MMM-yy) format.\r\n\r\n\r\nselect distinct DAT_TXN, AMT_TXN, TXT_TXN_DESC, NAM_BRANCH, a.CTR_UPDAT_SRLNO,lpad(rownum,5,~0~) \r\nfrom ch_nobook a, ba_cc_brn_mast b\r\nwhere a.COD_CC_BRN_TXN = b.COD_CC_BRN \r\nand a.cod_acct_no = ~900002007345~ \r\nand a.cod_drcr=~C~ \r\nand SUBSTR(DAT_TXN,1,9)=?   < \'11-DEC-13\'\r\n\r\n\r\nThanks,\r\nRegards,\r\nDamith.\r\n', '', '', '', '', '', 'damith', '2013-12-11 08:19:12', 'I', 'Y', 'I', 'damith', '2013-12-11 08:19:12', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('397', '6', 'A', 'Dear Vikum,\r\n\r\nAs per the data and log files, the issue seems to be Utility Bill system somehow has been shut downed on 30th Nov, 1st Dec.(There were no log files created by the system for those days, if the system is up and running the log files has to be created by the system whether there are data to proceed or not).\r\n\r\nBut for 7th ,8th Dec there were no data on oracle table for proceed.\r\n\r\nSince our system picks only data for the running date, the missed transaction will not be proceed by our system.\r\n\r\nTherefore our conclusion on the issue is the system has to be shut downed on 30th Nov, 1st Dec weekend, Please investigate whether there were any server or tomcat issue from your side.\r\n\r\nThanks,\r\nRegards,\r\nDamith.\r\n', '', '', '', '', '', 'damith', '2013-12-13 06:03:30', 'I', 'Y', 'I', 'damith', '2013-12-13 06:03:30', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
