INSERT INTO `ticket_reply_mst` VALUES ('421', '1', 'R', 'A query to be created  to find user-vise stat of \r\n1)Own account trfs\r\n2)Third Party trfs\r\n3)Bill Payments\r\n4)CC settlements\r\n\r\nfor a given time period ', '', '', '', '', '', 'bocuser', '2013-12-13 04:20:46', 'I', 'Y', 'I', 'bocuser', '2013-12-13 04:20:46', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('421', '2', 'A', 'SELECT u.sumuserid,u.sumcode,u.sumname,\r\nIFNULL(SUM(CASE col WHEN 1 THEN cnt END),0) as BillPayment,\r\nIFNULL(SUM(CASE col WHEN 2 THEN cnt END),0) as CreditCard,\r\nIFNULL(SUM(CASE col WHEN 3 THEN cnt END),0) as FundTransfer,\r\nIFNULL(SUM(CASE col WHEN 4 THEN cnt END),0) as ThirdParty\r\n FROM\r\n(select 1 AS col,count(*) AS cnt,bplusrid AS usrid from msebkbplog where bpltxndate BETWEEN \'2007-09-09\' and \'2007-09-15\'\r\ngroup by bplusrid\r\nUNION\r\nselect 2 AS col,count(*) AS cnt,cclusrid AS usrid from msebkcclog where ccltxndate BETWEEN \'2007-09-09\' and \'2007-09-15\'\r\ngroup by cclusrid\r\nUNION\r\nselect 3 AS col,count(*) AS cnt,ftlusrid AS usrid from msebkftlog where ftltxndate BETWEEN \'2007-09-09\' and \'2007-09-15\'\r\ngroup by ftlusrid\r\nUNION\r\nselect 4 AS col,IFNULL(count(*),0) AS cnt,tplusrid AS usrid from msebktplog where tpltxndate BETWEEN \'2007-09-09\' and \'2007-09-15\' \r\ngroup by tplusrid) t1\r\nleft JOIN msebkusrmst u ON t1.usrid=u.sumuserid where t1.usrid =\'7\'\r\nGROUP BY usrid', '', '', '', '', '', 'janaka', '2013-12-13 06:38:07', 'I', 'Y', 'I', 'janaka', '2013-12-13 06:38:07', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
