INSERT INTO `ticket_reply_mst` VALUES ('662', '1', 'R', 'Utility online system was completely down on 23-04-2014 due to a Connection issue. Since this is a total system failure, please attend to this issue urgently and make arrangements fix the issue permanently.\r\nbill pay log attached', '', '', '', '', '', 'ndbbank', '2014-04-24 02:40:16', 'I', 'Y', 'I', 'ndbbank', '2014-04-24 02:40:16', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('662', '2', 'A', 'this issue raised due to connection pool exhausting, issue can be sorted by implementing a more advanced new connection pool. but the java version should be update to implement the new methods. Please check whether there is any possibility to do that. We will also investigate whether there is an issue on closing connections from our side', '', '', '', '', '', 'damith', '2014-04-24 03:19:27', 'I', 'Y', 'I', 'damith', '2014-04-24 03:19:27', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('662', '3', 'A', 'We have temporary increase the connection pool size and decrease the idle connection releasing time, this will solve the problem for some time but you have to implement the new improved connection pool to solve the issue permanently. But for do this you have to update Java and tomcat versions. Therefore consider this as a high priority task.', '', '', '', '', '', 'damith', '2014-04-29 06:38:54', 'I', 'Y', 'I', 'damith', '2014-04-29 06:38:54', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('662', '4', 'A', 'We had setup the sever and install the application for UAT in 1st or 2nd week of the last month, but there are issues with dialog payment gateway connection, must be sorted out form NDB and Dialog. However our developers had come several time regarding this matter for change the connection parameters time to time as requested by NDB, which was a total waste of our time and no solution presented still. All the requested issues has been rectified in this release, note that this is not a delay from our side to transfer it to live. Its totally a NDB call.', '', '', '', '', '', 'damith', '2014-08-22 04:17:20', 'I', 'Y', 'I', 'damith', '2014-08-22 04:17:20', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
