INSERT INTO `ticket_reply_mst` VALUES ('694', '2', 'A', 'please execute following 2 SQLs and send the outputs accordingly\r\n\r\n\r\nsql1 :\r\n  select t1.contract_no,t1.category,t2.name,t1.product_type, \r\n  sum(t1.interest) as interest,sum(t1.capital) as capital,  \r\n  sum(t1.penalty) as penalty \r\n  from globus_collection_mst t1, globus_product_mst t2 \r\n  where t1.custno in(321230) \r\n  and t1.txndate between \'2013-04-01\' and \'2014-03-31\'\r\n  and SUBSTRING(t1.contract_no,1,2)<>\'MG\'  \r\n  and t1.product_type=t2.code \r\n  group by t1.contract_no \r\n  order by t2.name,t1.contract_no \r\n\r\n\r\nsql2:\r\n select t1.contract_no,t1.category,t2.name,t1.product_type, \r\n sum(t1.interest) as interest,sum(t1.capital) as capital, \r\n sum(t1.penalty) as penalty \r\n from globus_collection_mst t1, globus_product_mst t2 \r\n where t1.custno in(321230) \r\n and t1.txndate between \'2013-04-01\' and \'2014-03-31\' \r\n and t1.category<>3120  \r\n and t1.product_type=t2.code \r\n group by t1.contract_no \r\n order by t2.name,t1.contract_no \r\n', '', '', '', '', '', 'damith', '2014-05-16 01:42:21', 'I', 'Y', 'I', 'damith', '2014-05-16 01:42:21', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
