INSERT INTO `ticket_reply_mst` VALUES ('803', '1', 'R', 'Dear All,\r\nWhen we do a utility payment reversal in T24 corebanking system, utility system still picks the reversed transaction. In corebanking system we reverse the same transaction with the same bank reference number. (It is not just debit the same amount which is credited previously).\r\nSo please handle these reversals in the below mentioned manner.\r\n1.0 Reversal record too will be downloaded into the Mysql table.\r\n2.0 If you find any txn with a negative value, please get the bank reference number of that particuler transaction and search in the same table for same bank reference number.\r\n\r\n3.0 There should be one record with the same bank reference number. That is the initial transaction before reversal take place. \r\n\r\n4.0 Mark both the transactions as reversals and these two transactions should not come to down load file and should be indicate in the reversals report.\r\n\r\nPlease contact me if you need more details on this issue.\r\n\r\nAppreciate if you could make arrangments to fix the issue at your earlist.\r\n\r\nThanks\r\n\r\nVickum\r\n\r\n\r\n ', '', '', '', '', '', 'ndbbank', '2014-07-22 06:24:40', 'I', 'Y', 'I', 'ndbbank', '2014-07-22 06:24:40', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '2', 'A', 'Dear NDB user\r\n\r\nThe current set up of the utility system is such that the transaction reference number is not synchronized with utility system. The system only filters transactions with negative balances to be rejected. Also reversal report is generated presently only for particular service providers who have requested the same as part of the scope of implementation. This has been the functionality as per original system implementation.\r\n \r\nTherefore if we have to also capture the reference number and run the process required by you it will be a system customization request. Therefore please be kind enough to raise a system change request so that we may send you a quotation for same.  When raising the system change request please address the following as well\r\n* Is this to be done only for file downloads based offline utility providers?\r\n* If only offline utility providers are to be considered the reversal will be checked only from the records that have not been already downloaded (if the reversal is for a record already downloaded then the process cannot be applied since record has been downloaded)\r\n* With regard to on line utility providers the above process cannot be applied since the communication of transaction is real time. (We can only follow the current procedure of blocking negative balances.) \r\n* Is the reversal report to be generated for all providers (formats for same)\r\n\r\nSince this is not a system error we are marking this issue for closure.', '', '', '', '', '', 'damith', '2014-07-24 02:23:00', 'I', 'Y', 'I', 'damith', '2014-07-24 02:23:00', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '3', 'R', 'Dear All,\r\n\r\n   This is a logical error in the process of eliminating reversals. Getting the Corebanking reference number is not required by us. Only thing is, it requires by the utility system to handle the scenario effectively.\r\n   This may require system change. But it should not be a chargable CR as this is a bug in the system. Eventhough system provides number of reports, this scenarios has not being handled correctly. If there is a way/ alternative workaroung to handle the scenario in the system, we can catagorize this as a Chargable CR.\r\n\r\nRegards\r\nVickum ', '', '', '', '', '', 'ndbbank', '2014-07-25 06:10:14', 'I', 'Y', 'I', 'ndbbank', '2014-07-25 06:10:14', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '4', 'A', 'Dear Vickum,\r\n\r\nThere is no system bug nor logical error, it is only that NDB is requesting a new logic to be incorporated for reversals due to a requirement raised by utility providers from NDB.\r\n\r\nThe reversal procedure of checking on the negative amount and stopping the transaction is done based on NDB requirements from the date of implementation which was several years ago. The system provides a reversed transaction request report which NDB sends to the service providers. \r\n\r\nThis new requirement has come about because utility provider requested NDB to send the original transaction also eliminated from the transaction list by comparing the reversals. The reversal comes to the system as a negative amount and there was no requirement communicated by NDB at any time that the reversal has to be matched with the original transaction during original implementation and UAT.\r\n\r\nAlso the only correct way to match the reversals would be by transaction reference since the transaction could have a unique reference in the core system? We would be more than happy to hear of any other logic that NDB can come up with to match the reversals.\r\n\r\nAlso you will have to still address the other questions raised with regard to the reversal matching in the download which are also new developments that will have to be looked at.\r\n\r\n\r\n\r\n\r\n\r\n', '', '', '', '', '', 'damith', '2014-07-28 01:30:53', 'I', 'Y', 'I', 'damith', '2014-07-28 01:30:53', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '5', 'R', 'Dear All,\r\n\r\nThis issue is reported by our processing team. Not by any of the utility providers. We cannot totaly agree with your last post. Only issue here is this particuler scenario was not identified during initial implementation few years back. \r\nI do not see any other way to validate this scenario other than using the bank reference number. \r\nPlease tell me how do you suggest us to handle this issue using reports? When two lines got inserted into the same table one with a positive txn amount and another one with negative transaction amount, is it sufficient enough to ignore the negative line? Then user will get the funds back to his account. But since the positive value still exisit in the table, he will get the credit into his utility account. Thats why we always say this as a logical error.\r\n\r\nRegards\r\n\r\nVickum\r\n', '', '', '', '', '', 'ndbbank', '2014-07-28 04:05:46', 'I', 'Y', 'I', 'ndbbank', '2014-07-28 04:05:46', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '6', 'A', 'Dear Vickum,\r\n\r\nThe issue is not with carrying out the modifications requested by you. It is a change in the functionality request therefore it is a change request. \r\n\r\nAlso going by the experience of the other banks using the same system they all have in place a process by which they send the error reports to the respective service providers for reversals which is always an offline process.\r\n\r\nAs such we can not under any circumstance accept you interpretation of the issue as a system bug or system error. Our report is that there is no system bug to be fixed.\r\n\r\nThere is no validation on the previous transactions that has taken place even if there is a negative value. Even if there is an insert of a negative amount the negative transaction only is dropped due to several reasons\r\n\r\n1). Transaction amounts can only have positive balances\r\n\r\n2.) The transaction may have already been communicated to the service provider (specially in case online). In which case no validation or change can be done. \r\n\r\n2). If the offline file has already been downloaded automatically then too there is no validation that can be done on the reversal.\r\n  \r\nSo even if you try to validate still you will end up with reversals that have not been updated in the file sent to utility provider. \r\n\r\nIf you need the validation methodology changed please be kind enough to raise a change request, whilst clarifying the questions raised in our previous responses so that the customization for NDB can be carried out.\r\n', '', '', '', '', '', 'damith', '2014-07-28 04:55:04', 'I', 'Y', 'I', 'damith', '2014-07-28 04:55:04', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('803', '7', 'R', 'Dear All,\r\n\r\nI do understant that this needs to be handled as a CR. But this should not be a chargable one.\r\nPlease share with me your CR format.\r\n\r\nRegards\r\n\r\nVickum\r\n ', '', '', '', '', '', 'ndbbank', '2014-07-28 06:25:08', 'I', 'Y', 'I', 'ndbbank', '2014-07-28 06:25:08', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
