INSERT INTO `ticket_reply_mst` VALUES ('803', '13', 'R', 'Dear Damith,\r\n\r\nWe do not want to proceed with the CR. Instead of that, please make arrangements to fix the riversals issues in the existing system. \r\n\r\nNo need to validate trasactions against the bank reference number (CR). There is a validation already in place in the system to handle  riversals. Therefore please see as to why these transactions are not being captured to the validation already in place.\r\n\r\nAfter system upgrade, now all the riversals being captured to the downlod file. Hence we need a solution as soon as possible.\r\n\r\nRegards\r\n\r\nVickum\r\n', '', '', '', '', '', 'ndbbank', '2014-11-17 23:35:40', 'I', 'Y', 'I', 'ndbbank', '2014-11-17 23:35:40', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
