INSERT INTO `ticket_reply_mst` VALUES ('822', '1', 'R', 'The generated letter picks only the balance of Feea savings a/c (106590000372) and NOT the interest earned, in the BCU Letter. (Period 01.04.2013 to 31.03.2014).\r\n\r\nT24 system account statement and the BCS letter attached,', '', '', '', '', '', 'ndbbank', '2014-08-14 04:55:24', 'I', 'Y', 'I', 'ndbbank', '2014-08-14 04:55:24', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('822', '2', 'A', 'please execute the following and send me the out puts\r\n\r\nSQL 1:\r\nselect t1.acc_no,t1.product_code,sum(t1.gross_interest) as gross, \r\n sum(t1.wht) as wht,sum(t1.debit_tax) debittax,t2.name,t1.currency \r\n  from flexcube_tax_mst t1, flexcube_product_mst t2 \r\n  where t1.custno in(14584) \r\n  and t1.txndate between \'2014-04-01\' and \'2014-04-01\'  \r\n  and TRIM(LEADING \'0\' FROM t1.product_code)=t2.code \r\n  and t2.category=\'S\' \r\n  group by t1.acc_no \r\n  order by t2.name,t1.acc_no,t1.currency\r\n\r\nSQL 2: \r\nselect t1.acc_no,t1.product_code,sum(t1.gross_interest) as gross, \r\n sum(t1.wht) as wht,sum(t1.debit_tax) debittax,t1.currency,TRIM(LEADING \'0\' FROM t1.product_code)  AS product_code\r\n  from flexcube_tax_mst t1\r\n  where t1.custno in(14584) \r\n  and t1.txndate between \'2014-04-01\' and \'2014-04-01\'  \r\n  group by t1.acc_no \r\n  order by t1.acc_no,t1.currency\r\n\r\nSQL 3: \r\nSELECT * FROM flexcube_product_mst', '', '', '', '', '', 'damith', '2014-08-20 05:32:08', 'I', 'Y', 'I', 'damith', '2014-08-20 05:32:08', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
INSERT INTO `ticket_reply_mst` VALUES ('822', '3', 'A', 'Please ignore previous,\r\n\r\nplease execute the following and send me the out puts \r\n\r\nSQL 1: \r\nselect t1.acc_no,t1.product_code,sum(t1.gross_interest) as gross, \r\nsum(t1.wht) as wht,sum(t1.debit_tax) debittax,t2.name,t1.currency \r\nfrom flexcube_tax_mst t1, flexcube_product_mst t2 \r\nwhere t1.custno in(14584) \r\nand t1.txndate between \'2013-04-01\' and \'2014-03-31\' \r\nand TRIM(LEADING \'0\' FROM t1.product_code)=t2.code \r\nand t2.category=\'S\' \r\ngroup by t1.acc_no \r\norder by t2.name,t1.acc_no,t1.currency \r\n\r\nSQL 2: \r\nselect t1.acc_no,t1.product_code,sum(t1.gross_interest) as gross, \r\nsum(t1.wht) as wht,sum(t1.debit_tax) debittax,t1.currency,TRIM(LEADING \'0\' FROM t1.product_code) AS product_code \r\nfrom flexcube_tax_mst t1 \r\nwhere t1.custno in(14584) \r\nand t1.txndate between \'2013-04-01\' and \'2014-03-31\' \r\ngroup by t1.acc_no \r\norder by t1.acc_no,t1.currency \r\n\r\nSQL 3: \r\nSELECT * FROM flexcube_product_mst', '', '', '', '', '', 'damith', '2014-08-20 05:36:22', 'I', 'Y', 'I', 'damith', '2014-08-20 05:36:22', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
