INSERT INTO `ticket_reply_mst` VALUES ('937', '2', 'A', 'SQL1 :\r\nselect t1.*,t2.name \r\n  from globus_ld_mst t1, globus_product_mst t2 \r\n  where t1.custno in(151571) \r\n  and t1.txnyear=2014 \r\n  and t1.txnmonth=07\r\n  and ((t1.category between 21051 and 21059) or (t1.category=3130))  \r\n  and t1.category=t2.code \r\n  order by t2.name,t1.contract_no,t1.maturity_date\r\n\r\nSQL2 :\r\nselect t1.*\r\n  from globus_ld_mst t1\r\n  where t1.custno in(151571) \r\n  and t1.txnyear=2014 \r\n  and t1.txnmonth=07\r\n  and ((t1.category between 21051 and 21059) or (t1.category=3130))  \r\n  \r\n\r\nSQL3 :\r\nselect t1.*\r\n  from globus_ld_mst t1\r\n  where t1.custno in(151571) \r\n  and t1.txnyear=2014 \r\n  and t1.txnmonth=07\r\n\r\n\r\nSQL4 :\r\nselect t1.contract_no,t1.category,t2.name,t1.product_type, \r\n sum(t1.interest) as interest,sum(t1.capital) as capital,  \r\n sum(t1.penalty) as penalty \r\n  from globus_collection_mst t1, globus_product_mst t2 \r\n  where t1.custno in(151571) \r\n  and t1.txndate between \'2013-10-01\' and \'2014-03-31\' \r\n  and t1.category<>3120   \r\n  and t1.product_type=t2.code \r\n  group by t1.contract_no \r\n  order by t2.name,t1.contract_no\r\n\r\n\r\n\r\n\r\nSQL5 :\r\nselect t1.contract_no,t1.category,t1.product_type, \r\n sum(t1.interest) as interest,sum(t1.capital) as capital,  \r\n sum(t1.penalty) as penalty \r\n  from globus_collection_mst t1\r\n  where t1.custno in(151571) \r\n  and t1.txndate between \'2013-10-01\' and \'2014-03-31\' \r\n  and t1.category<>3120   \r\n  group by t1.contract_no\r\n\r\nSQL6 :\r\nselect t1.contract_no,t1.category,t1.product_type, \r\n sum(t1.interest) as interest,sum(t1.capital) as capital,  \r\n sum(t1.penalty) as penalty \r\n  from globus_collection_mst t1\r\n  where t1.custno in(151571) \r\n  and t1.txndate between \'2013-10-01\' and \'2014-03-31\' \r\n  group by t1.contract_no\r\n\r\nSQL7:\r\nselect * from globus_product_mst t2\r\n', '', '', '', '', '', 'damith', '2014-10-29 06:06:27', 'I', 'Y', 'I', 'damith', '2014-10-29 06:06:27', '', '', '1980-01-01 00:00:00', '', '', '1980-01-01 00:00:00');
