DROP TRIGGER IF EXISTS `history`;
DELIMITER ;;
CREATE TRIGGER `history` AFTER INSERT ON `support_ticket_mst` FOR EACH ROW INSERT INTO support_ticket_mst_hst 
(ticket_id, com_id, pro_id, title, importance, 
user_rank, assign_by, assign_to, assign_date, assign_remark,
 current_status, answr_date, usr_reply_date, closed_date, closed_by,
 reported_by, contact_no, rec_status, view_status, input_status, 
 input_usr, input_time, auth_stat1, auth_usr1, auth_time1, 
 auth_stat2, auth_usr2, auth_time2) 
 VALUES (NEW.ticket_id, NEW.com_id, NEW.pro_id, NEW.title, NEW.importance, 
 NEW.user_rank, NEW.assign_by, NEW.assign_to, NEW.assign_date, NEW.assign_remark,
  NEW.current_status, NEW.answr_date, NEW.usr_reply_date, NEW.closed_date, NEW.closed_by,
  NEW.reported_by, NEW.contact_no, NEW.rec_status, NEW.view_status, NEW.input_status, 
  NEW. input_usr, NEW.input_time, NEW.auth_stat1, NEW.auth_usr1, NEW.auth_time1, 
  NEW.auth_stat2, NEW.auth_usr2, NEW.auth_time2)
;
;;
DELIMITER ;
